import React from 'react';

class Table extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      students: [
        {
          id: 101,
          firstname: 'Wade',
          lastname: 'Wilson',
        },
        {
          id: 102,
          firstname: 'Steve',
          lastname: 'Rogers',
        },
        {
          id: 103,
          firstname: 'Bucky',
          lastname: 'Barnes'
        }
      ]
    };
  }

  render () {
    return (
      <div>
        <h1>Gradebook Sample App</h1>
      </div>
    )
  }

}

export default Table;
